import pdb
class Solution:
    # @param S, a string
    # @param L, a list of string
    # @return a list of integer
    def findSubstring(self, S, L):

        word_set = set(L)
        rst = []
        length = len(L[0])
        total_len =len(L)*length
        total_hash = 0
        for x in L:
            total_hash += hash(x)

        for i in xrange(len(S) - total_len + 1):
            if S[i:i+length] not in word_set:
                continue
            hash_val = 0
            for p2 in xrange(i, i + total_len, length):
                word = S[p2:p2 + length]
                if word not in word_set:
                    break
                hash_val += hash(word)
            #pdb.set_trace() 
            if hash_val == total_hash:
                rst.append(i)

        return rst

